exports.getModel = function (models, id) {
  //return models.reduce(
  //  (acc, robot) => robot.id == id ? robot : acc,
  //  undefined
  //);

  for (var _iterator = models[Symbol.iterator](), _step; !(_step = _iterator.next()).done;) {
    var model = _step.value;
    if (model.id == id) {
      return model;
    }
  }

  return undefined;
};

exports.addModel = function (models, model) {
  return models.push(model);
};

exports.updateModel = function (models, model) {
  for (var i = 0; i < models.length; i++) {
    if (models[i].id == model.id) {
      models[i] = model;
      return models;
    }
  }
};

exports.removeModel = function (models, id) {
  return models.filter(function (model) {
    return model.id != id;
  });
};

exports.maxId = function (models) {
  console.log(models.map(function (model) {
    return model.id;
  }));
  return Math.max.apply(Math, models.map(function (model) {
    return model.id;
  }));
};

